{"strNational":null,"strProfessional":"","strInternational":"","strEvents":"<\/ul> <h3>\u0414\u043e XVII \u0432\u0435\u043a\u0430 <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/518_%D0%B3%D0%BE%D0%B4\" title=\"518 \u0433\u043e\u0434\">518<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B8%D1%80_%D0%90%D0%BD%D1%82%D0%B8%D0%BE%D1%85%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9\" title=\"\u0421\u0435\u0432\u0438\u0440 \u0410\u043d\u0442\u0438\u043e\u0445\u0438\u0439\u0441\u043a\u0438\u0439\">\u0421\u0435\u0432\u0438\u0440<\/a>, \u043f\u0430\u0442\u0440\u0438\u0430\u0440\u0445 \u0410\u043d\u0442\u0438\u043e\u0445\u0438\u0439\u0441\u043a\u0438\u0439, \u0441\u043c\u0435\u0449\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%BD%D0%BE%D0%B4\" title=\"\u0421\u0438\u043d\u043e\u0434\">\u0441\u0438\u043d\u043e\u0434\u043e\u043c<\/a> \u0437\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%BE%D1%84%D0%B8%D0%B7%D0%B8%D1%82%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041c\u043e\u043d\u043e\u0444\u0438\u0437\u0438\u0442\u0441\u0442\u0432\u043e\">\u043c\u043e\u043d\u043e\u0444\u0438\u0437\u0438\u0442\u0441\u0442\u0432\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1364_%D0%B3%D0%BE%D0%B4\" title=\"1364 \u0433\u043e\u0434\">1364<\/a>&#160;\u2014 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%9E%D1%80%D0%B5\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041e\u0440\u0435\">\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041e\u0440\u0435<\/a>, \u043f\u043e\u043b\u043e\u0436\u0438\u0432\u0448\u0430\u044f \u043a\u043e\u043d\u0435\u0446 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B7%D0%B0_%D0%B1%D1%80%D0%B5%D1%82%D0%BE%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0437\u0430 \u0431\u0440\u0435\u0442\u043e\u043d\u0441\u043a\u043e\u0435 \u043d\u0430\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u043e\">\u0412\u043e\u0439\u043d\u0435 \u0437\u0430 \u0431\u0440\u0435\u0442\u043e\u043d\u0441\u043a\u043e\u0435 \u043d\u0430\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1399_%D0%B3%D0%BE%D0%B4\" title=\"1399 \u0433\u043e\u0434\">1399<\/a>&#160;\u2014 \u043a\u043e\u0440\u043e\u043b\u044c \u0410\u043d\u0433\u043b\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D1%87%D0%B0%D1%80%D0%B4_II\" title=\"\u0420\u0438\u0447\u0430\u0440\u0434 II\">\u0420\u0438\u0447\u0430\u0440\u0434 II<\/a> \u043e\u0442\u0440\u0435\u043a\u0430\u0435\u0442\u0441\u044f \u043e\u0442 \u043f\u0440\u0435\u0441\u0442\u043e\u043b\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1515_%D0%B3%D0%BE%D0%B4\" title=\"1515 \u0433\u043e\u0434\">1515<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D0%B9%D1%86%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0438\u044f\">\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0438\u044f<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b\u0430 \u0412\u0435\u0447\u043d\u044b\u0439 \u043c\u0438\u0440 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0435\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1567_%D0%B3%D0%BE%D0%B4\" title=\"1567 \u0433\u043e\u0434\">1567<\/a>&#160;\u2014 \u0432 \u043d\u043e\u0447\u044c \u0441 29 \u043d\u0430 30 \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u044f \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%88%D0%B5%D0%BB%D0%B0%D0%B4%D0%B0\" class=\"mw-redirect\" title=\"\u041c\u0438\u0448\u0435\u043b\u0430\u0434\u0430\">\u041c\u0438\u0448\u0435\u043b\u0430\u0434\u0430<\/a>, \u0441\u0442\u0430\u0432\u0448\u0430\u044f \u043e\u0434\u043d\u043e\u0439 \u0438\u0437 \u043f\u0440\u0438\u0447\u0438\u043d \u043d\u0430\u0447\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%B0%D1%8F_%D0%93%D1%83%D0%B3%D0%B5%D0%BD%D0%BE%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" class=\"mw-redirect\" title=\"\u0412\u0442\u043e\u0440\u0430\u044f \u0413\u0443\u0433\u0435\u043d\u043e\u0442\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u0442\u043e\u0440\u043e\u0439 \u0413\u0443\u0433\u0435\u043d\u043e\u0442\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>.<\/li><\/ul><h3><a href=\"https:\/\/ru.wikipedia.org\/wiki\/XVII_%D0%B2%D0%B5%D0%BA\" title=\"XVII \u0432\u0435\u043a\">XVII \u0432\u0435\u043a<\/a> <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1621_%D0%B3%D0%BE%D0%B4\" title=\"1621 \u0433\u043e\u0434\">1621<\/a>&#160;\u2014 \u0417\u0430\u043a\u043b\u044e\u0447\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%BE%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80%D0%BD%D1%8B%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80\" title=\"\u0425\u043e\u0442\u0438\u043d\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\">\u0425\u043e\u0442\u0438\u043d\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440<\/a>, \u043f\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B0\" title=\"\u041f\u043e\u043b\u044c\u0448\u0430\">\u041f\u043e\u043b\u044c\u0448\u0430<\/a> \u043e\u0431\u044f\u0437\u0430\u043b\u0430\u0441\u044c \u043f\u0435\u0440\u0435\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D1%86%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u0446\u0438\u044f\">\u0422\u0443\u0440\u0446\u0438\u0435\u0439<\/a> \u0443\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u0442\u044c \u0437\u0430\u043f\u043e\u0440\u043e\u0436\u0441\u043a\u0438\u0445 \u043a\u0430\u0437\u0430\u043a\u043e\u0432 \u043e\u0442 \u043d\u0430\u0431\u0435\u0433\u043e\u0432 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%8B%D0%BC\" title=\"\u041a\u0440\u044b\u043c\">\u041a\u0440\u044b\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1650_%D0%B3%D0%BE%D0%B4\" title=\"1650 \u0433\u043e\u0434\">1650<\/a><ul><li>\u0413\u0435\u043d\u0440\u0438 \u0420\u043e\u0431\u0438\u043d\u0441\u043e\u043d (Henry Robinson) \u043e\u0442\u043a\u0440\u044b\u043b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u043f\u0435\u0440\u0432\u043e\u0435 \u0432 \u043c\u0438\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D1%87%D0%BD%D0%BE%D0%B5_%D0%B0%D0%B3%D0%B5%D0%BD%D1%82%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0411\u0440\u0430\u0447\u043d\u043e\u0435 \u0430\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u043e\">\u0431\u0440\u0430\u0447\u043d\u043e\u0435 \u0430\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u043e<\/a>.<\/li><li>\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0438\u044f \u043f\u0440\u0438\u0437\u043d\u0430\u043b\u0430 \u043f\u0440\u0430\u0432\u0430 \u0410\u043d\u0433\u043b\u0438\u0438 \u043d\u0430 \u043e\u0441\u0442\u0440\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B3-%D0%90%D0%B9%D0%BB%D0%B5%D0%BD%D0%B4\" title=\"\u041b\u043e\u043d\u0433-\u0410\u0439\u043b\u0435\u043d\u0434\">\u041b\u043e\u043d\u0433-\u0410\u0439\u043b\u0435\u043d\u0434<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0410\u043c\u0435\u0440\u0438\u043a\u0430\">\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0410\u043c\u0435\u0440\u0438\u043a\u0430<\/a>).<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1655_%D0%B3%D0%BE%D0%B4\" title=\"1655 \u0433\u043e\u0434\">1655<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%BE-%D0%BF%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1654%E2%80%941667)\" title=\"\u0420\u0443\u0441\u0441\u043a\u043e-\u043f\u043e\u043b\u044c\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1654\u20141667)\">\u0420\u0443\u0441\u0441\u043a\u043e-\u043f\u043e\u043b\u044c\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1654\u20141667)<\/a>: \u0440\u0443\u0441\u0441\u043a\u043e-\u043a\u0430\u0437\u0430\u0446\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u043e\u0434\u0435\u0440\u0436\u0430\u043b\u0438 \u043f\u043e\u0431\u0435\u0434\u0443 \u043d\u0430\u0434 \u043f\u043e\u043b\u044c\u0441\u043a\u0438\u043c \u0432\u043e\u0439\u0441\u043a\u043e\u043c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D0%BE%D0%B4_%D0%93%D0%BE%D1%80%D0%BE%D0%B4%D0%BA%D0%BE%D0%BC\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u043e\u0434 \u0413\u043e\u0440\u043e\u0434\u043a\u043e\u043c\">\u0411\u0438\u0442\u0432\u0435 \u043f\u043e\u0434 \u0413\u043e\u0440\u043e\u0434\u043a\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1669_%D0%B3%D0%BE%D0%B4\" title=\"1669 \u0433\u043e\u0434\">1669<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B1%D0%BE%D1%80_%D0%A1%D0%B2%D1%8F%D1%82%D1%8B%D1%85_%D0%A1%D1%82%D0%B0%D0%BD%D0%B8%D1%81%D0%BB%D0%B0%D0%B2%D0%B0_%D0%B8_%D0%92%D0%B0%D1%86%D0%BB%D0%B0%D0%B2%D0%B0\" class=\"mw-redirect\" title=\"\u0421\u043e\u0431\u043e\u0440 \u0421\u0432\u044f\u0442\u044b\u0445 \u0421\u0442\u0430\u043d\u0438\u0441\u043b\u0430\u0432\u0430 \u0438 \u0412\u0430\u0446\u043b\u0430\u0432\u0430\">\u0421\u043e\u0431\u043e\u0440\u0435 \u0421\u0432\u044f\u0442\u044b\u0445 \u0421\u0442\u0430\u043d\u0438\u0441\u043b\u0430\u0432\u0430 \u0438 \u0412\u0430\u0446\u043b\u0430\u0432\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%9A%D0%BE%D1%80%D0%B8%D0%B1%D1%83%D1%82_%D0%92%D0%B8%D1%88%D0%BD%D0%B5%D0%B2%D0%B5%D1%86%D0%BA%D0%B8%D0%B9\" title=\"\u041c\u0438\u0445\u0430\u0438\u043b \u041a\u043e\u0440\u0438\u0431\u0443\u0442 \u0412\u0438\u0448\u043d\u0435\u0432\u0435\u0446\u043a\u0438\u0439\">\u041c\u0438\u0445\u0430\u0438\u043b \u041a\u043e\u0440\u0438\u0431\u0443\u0442 \u0412\u0438\u0448\u043d\u0435\u0432\u0435\u0446\u043a\u0438\u0439<\/a> \u043a\u043e\u0440\u043e\u043d\u043e\u0432\u0430\u043d \u041a\u043e\u0440\u043e\u043b\u0451\u043c \u041f\u043e\u043b\u044c\u0441\u043a\u0438\u043c \u0438 \u0412\u0435\u043b\u0438\u043a\u0438\u043c \u043a\u043d\u044f\u0437\u0435\u043c \u041b\u0438\u0442\u043e\u0432\u0441\u043a\u0438\u043c.<\/li><\/ul><h3><a href=\"https:\/\/ru.wikipedia.org\/wiki\/XVIII_%D0%B2%D0%B5%D0%BA\" title=\"XVIII \u0432\u0435\u043a\">XVIII \u0432\u0435\u043a<\/a> <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1717_%D0%B3%D0%BE%D0%B4\" title=\"1717 \u0433\u043e\u0434\">1717<\/a>&#160;\u2014 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e <a href=\"https:\/\/en.wikipedia.org\/wiki\/1717_Guatemala_earthquake\" class=\"extiw\" title=\"en:1717 Guatemala earthquake\">\u0413\u0432\u0430\u0442\u0435\u043c\u0430\u043b\u044c\u0441\u043a\u043e\u0435 \u0437\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0435 1717 \u0433\u043e\u0434\u0430<\/a> en, \u0447\u0430\u0441\u0442\u0438\u0447\u043d\u043e \u0440\u0430\u0437\u0440\u0443\u0448\u0438\u0432\u0448\u0435\u0435 \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D1%82%D0%B8%D0%B3%D1%83%D0%B0-%D0%93%D1%83%D0%B0%D1%82%D0%B5%D0%BC%D0%B0%D0%BB%D0%B0\" title=\"\u0410\u043d\u0442\u0438\u0433\u0443\u0430-\u0413\u0443\u0430\u0442\u0435\u043c\u0430\u043b\u0430\">\u0410\u043d\u0442\u0438\u0433\u0443\u0430-\u0413\u0443\u0430\u0442\u0435\u043c\u0430\u043b\u0430<\/a>, \u0441\u0442\u043e\u043b\u0438\u0446\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB-%D0%BA%D0%B0%D0%BF%D0%B8%D1%82%D0%B0%D0%BD%D1%81%D1%82%D0%B2%D0%BE_%D0%93%D0%B2%D0%B0%D1%82%D0%B5%D0%BC%D0%B0%D0%BB%D0%B0\" title=\"\u0413\u0435\u043d\u0435\u0440\u0430\u043b-\u043a\u0430\u043f\u0438\u0442\u0430\u043d\u0441\u0442\u0432\u043e \u0413\u0432\u0430\u0442\u0435\u043c\u0430\u043b\u0430\">\u0413\u0435\u043d\u0435\u0440\u0430\u043b-\u043a\u0430\u043f\u0438\u0442\u0430\u043d\u0441\u0442\u0432\u0430 \u0413\u0432\u0430\u0442\u0435\u043c\u0430\u043b\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1736_%D0%B3%D0%BE%D0%B4\" title=\"1736 \u0433\u043e\u0434\">1736<\/a>&#160;\u2014 \u0414\u0430\u043d \u0443\u043a\u0430\u0437 \u043e\u0431 \u043e\u0447\u0438\u0441\u0442\u043a\u0435 \u0440\u0435\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%B9%D0%BA%D0%B0_(%D1%80%D0%B5%D0%BA%D0%B0)\" title=\"\u041c\u043e\u0439\u043a\u0430 (\u0440\u0435\u043a\u0430)\">\u041c\u043e\u0439\u043a\u0438<\/a> \u0438 \u0443\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u0435 \u043f\u043e\u0441\u0442\u043e\u044f\u043d\u043d\u043e\u0439 \u043d\u0430\u0431\u0435\u0440\u0435\u0436\u043d\u043e\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1739_%D0%B3%D0%BE%D0%B4\" title=\"1739 \u0433\u043e\u0434\">1739<\/a>&#160;\u2014 \u041f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D0%B3%D1%80%D0%B0%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80%D0%BD%D1%8B%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80_(1739)\" title=\"\u0411\u0435\u043b\u0433\u0440\u0430\u0434\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 (1739)\">\u0411\u0435\u043b\u0433\u0440\u0430\u0434\u0441\u043a\u043e\u043c\u0443 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0443<\/a> \u0420\u043e\u0441\u0441\u0438\u044f \u043f\u043e\