13<\/a>&#160;\u2014 \u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u043b\u0451\u0442\u0447\u0438\u043a \u041c\u043e\u0440\u0438\u0441 \u041f\u0440\u0435\u0432\u043e (Maurice Pr\u00e9vost) \u043d\u0430 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0435 \u00abDeperdussin\u00bb \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u0440\u0435\u0432\u044b\u0441\u0438\u043b \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c 200 \u043a\u043c\/\u0447.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1916_%D0%B3%D0%BE%D0%B4\" title=\"1916 \u0433\u043e\u0434\">1916<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%BA%D1%84%D0%B5%D0%BB%D0%BB%D0%B5%D1%80,_%D0%94%D0%B6%D0%BE%D0%BD_%D0%94%D1%8D%D0%B2%D0%B8%D1%81%D0%BE%D0%BD\" title=\"\u0420\u043e\u043a\u0444\u0435\u043b\u043b\u0435\u0440, \u0414\u0436\u043e\u043d \u0414\u044d\u0432\u0438\u0441\u043e\u043d\">\u0414\u0436\u043e\u043d \u0420\u043e\u043a\u0444\u0435\u043b\u043b\u0435\u0440<\/a>, \u043e\u0441\u043d\u043e\u0432\u0430\u0442\u0435\u043b\u044c \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Standard_Oil\" title=\"Standard Oil\">\u0421\u0442\u0430\u043d\u0434\u0430\u0440\u0442 \u041e\u0439\u043b<\/a>\u00bb, \u0441\u0442\u0430\u043b \u043f\u0435\u0440\u0432\u044b\u043c \u0432 \u043c\u0438\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BB%D0%BB%D0%B8%D0%B0%D1%80%D0%B4%D0%B5%D1%80\" class=\"mw-redirect\" title=\"\u041c\u0438\u043b\u043b\u0438\u0430\u0440\u0434\u0435\u0440\">\u043c\u0438\u043b\u043b\u0438\u0430\u0440\u0434\u0435\u0440\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BF%D0%B8%D1%82%D1%83%D0%BB%D1%8F%D1%86%D0%B8%D1%8F\" title=\"\u041a\u0430\u043f\u0438\u0442\u0443\u043b\u044f\u0446\u0438\u044f\">\u043a\u0430\u043f\u0438\u0442\u0443\u043b\u044f\u0446\u0438\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0411\u043e\u043b\u0433\u0430\u0440\u0438\u044f\">\u0411\u043e\u043b\u0433\u0430\u0440\u0438\u0438<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041f\u0435\u0440\u0432\u043e\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a>&#160;\u2014 \u0418\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0440\u043e\u0433\u0440\u0430\u0434\u0430<\/a> \u043e\u0442\u043f\u043b\u044b\u043b \u043f\u0430\u0440\u043e\u0445\u043e\u0434 \u00ab\u041e\u0431\u0435\u0440\u0431\u0443\u0440\u0433\u043e\u043c\u0438\u0441\u0442\u0440 \u0425\u0430\u043a\u0435\u043d\u00bb, \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0430\u043c\u0438 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0431\u044b\u043b\u0438 \u0444\u0438\u043b\u043e\u0441\u043e\u0444\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%91%D0%B5%D1%80%D0%B4%D1%8F%D0%B5%D0%B2\" class=\"mw-redirect\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0411\u0435\u0440\u0434\u044f\u0435\u0432\">\u041d.&#160;\u0410.&#160;\u0411\u0435\u0440\u0434\u044f\u0435\u0432<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D0%BA,_%D0%A1%D0%B5%D0%BC%D1%91%D0%BD_%D0%9B%D1%8E%D0%B4%D0%B2%D0%B8%D0%B3%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0424\u0440\u0430\u043d\u043a, \u0421\u0435\u043c\u0451\u043d \u041b\u044e\u0434\u0432\u0438\u0433\u043e\u0432\u0438\u0447\">\u0421.&#160;\u041b.&#160;\u0424\u0440\u0430\u043d\u043a<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BB%D1%8C%D0%B8%D0%BD,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0418\u043b\u044c\u0438\u043d, \u0418\u0432\u0430\u043d \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447\">\u0418.&#160;\u0410.&#160;\u0418\u043b\u044c\u0438\u043d<\/a>, \u0421.&#160;\u0415.&#160;\u0422\u0440\u0443\u0431\u0435\u0446\u043a\u043e\u0439, \u0411.&#160;\u041f.&#160;\u0412\u044b\u0448\u0435\u0441\u043b\u0430\u0432\u0446\u0435\u0432, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%9A%D0%B8%D0%B7%D0%B5%D0%B2%D0%B5%D1%82%D1%82%D0%B5%D1%80\" class=\"mw-redirect\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u041a\u0438\u0437\u0435\u0432\u0435\u0442\u0442\u0435\u0440\">\u0410.&#160;\u0410.&#160;\u041a\u0438\u0437\u0435\u0432\u0435\u0442\u0442\u0435\u0440<\/a>, \u041c.&#160;\u0410.&#160;\u0418\u043b\u044c\u0438\u043d (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D0%BE%D1%80%D0%B3%D0%B8%D0%BD,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041e\u0441\u043e\u0440\u0433\u0438\u043d, \u041c\u0438\u0445\u0430\u0438\u043b \u0410\u043d\u0434\u0440\u0435\u0435\u0432\u0438\u0447\">\u041e\u0441\u043e\u0440\u0433\u0438\u043d<\/a>), \u041c.&#160;\u041c.&#160;\u041d\u043e\u0432\u0438\u043a\u043e\u0432, \u0410.&#160;\u0418.&#160;\u0423\u0433\u0440\u0438\u043c\u043e\u0432, \u0412.&#160;\u0412.&#160;\u0417\u0432\u043e\u0440\u044b\u043a\u0438\u043d, \u041d.&#160;\u0410.&#160;\u0426\u0432\u0435\u0442\u043a\u043e\u0432, \u0418.&#160;\u042e.&#160;\u0411\u0430\u043a\u043a\u0430\u043b, \u043f\u0440\u043e\u0444. \u041c\u0412\u0422\u0423 \u0412.&#160;\u